syntax = "proto3";

package make87_messages_ros2.jazzy.ublox_msgs.msg;


message NavPVT7 {
     uint32 i_tow = 1;
     uint32 year = 2;
     uint32 month = 3;
     uint32 day = 4;
     uint32 hour = 5;
     uint32 min = 6;
     uint32 sec = 7;
     uint32 valid = 8;
     uint32 t_acc = 9;
     int32 nano = 10;
     uint32 fix_type = 11;
     uint32 flags = 12;
     uint32 flags2 = 13;
     uint32 num_sv = 14;
     int32 lon = 15;
     int32 lat = 16;
     int32 height = 17;
     int32 h_msl = 18;
     uint32 h_acc = 19;
     uint32 v_acc = 20;
     int32 vel_n = 21;
     int32 vel_e = 22;
     int32 vel_d = 23;
     int32 g_speed = 24;
     int32 heading = 25;
     uint32 s_acc = 26;
     uint32 head_acc = 27;
     uint32 p_dop = 28;
    repeated uint32 reserved1 = 29;
}
